import React from 'react'

function App() {
  return (
    <div class="container">
    <h1>About Us</h1>
    <p>Welcome to our website! We are a group of professionals who are passionate about helping our clients achieve their goals. Our team consists of experts in various fields, including marketing, finance, and technology. We have a proven track record of success in helping our clients grow their businesses and achieve their goals.</p>
    <p>Our mission is to provide our clients with the best possible service and support. We believe in building long-term relationships with our clients, and we are committed to helping them succeed in their business ventures.</p>
    <p>If you are looking for expert advice and support, we would be happy to help you. Feel free to contact us at any time, and we will do our best to assist you.</p>
</div>
  )
}

export default App
